  {
    src: require('assets/photos/TanayDodgeball.JPG'),
    width: 3,
    height: 2
  },
  {
    src: require('assets/photos/WillParkREAL-MelK.jpg'),
    width: 2,
    height: 2.5
  },
  {
    src: require('assets/photos/YannickBohbot-Dridi-MK.JPG'),
    width: 2,
    height: 3
  },
];

const content = {
    header: "Multimedia",
    description: "I love portrait photography and videography."
}

const gridStyle = css`
    .col {
      padding-left: 0 !important;
      padding-right: 1em;
    };

    .col >* {
      margin-bottom: 1em;
    }
`;

export default class PageMultimedia extends Component {
  render() {
    return (
      <div css={gridStyle}> 
        <Article
          {...content}
        >
          <h3>Videography</h3>
          <Container gutterWidth={0}>
            <Row>
              <Col className="col" sm={6}>
                <ReactPlayer url='https://www.youtube.com/watch?v=ysz5S6PUM-U' />
                <ReactPlayer url='https://www.youtube.com/watch?v=ysz5S6PUM-U' />
              </Col>
              <Col className="col" sm={6}>
                <ReactPlayer url='https://www.youtube.com/watch?v=ysz5S6PUM-U' />
                <ReactPlayer url='https://www.youtube.com/watch?v=ysz5S6PUM-U' />
              </Col>
            </Row>
          </Container>
          <h3>Photography</h3>
          <PhotoGallery photos={photos} direction={"column"} />
        </Article>
      </div>
    );
  }
}
